Answer: Clang optimizations are \em{very} limited under Linux. You have the `-O3` flag with `-fprofile-instr-Generate` and `-fprofile-force`. These can actually be used with any C++ compiler, but they are only really useful with gcc.

\begin{blockquote}
`-O3` - Enable all optimization and run-time code size features

`-fprofile-instr-generate` (GCC)

`-fprofile-instrument` (TDM-GCC)

Create assembly profiles for CPU and other ISA's. If a profile is
valid and `-fprofile-generate` is passed the compiler will generate
all of the asm code to measure execution time; if `-fprofile-generate` isn't passed a dummy header with `extern __attribute__((always_inline)) unsigned long __profile_func(void);` function is added. The
resulting asm code can be parsed by the C profile code to perform
optimizations.

`-fprofile-force` or
`-finstrument-full`

If you are using the `fprofile` flags (see below) and want to create
profile symbols in C++ code, pass this to force the asm code to be
generated for the entire code. In some cases, if you only pass `-fprofile-generate`, code may be generated and if your program
is large enough it might not fit in memory or be generated in
completion time. If an abort occurs, an assertion may be violated or
the executable size may be reached. `-finstrument-full` is a synonym
for `-fprofile-force` in a non-GCC compiler. It is normally not worth changing

`-fprofile-generate` (GCC)

`-fprofile-instrument` (TDM-GCC)

Informs the compiler to generate the asm code to produce profile
statistics for execution time. This is currently only supported on GCC
and TDM-GCC with the C++ compiler.

`-finstrument-functions` (TDM-GCC)

If this is being compiled with C++ and there are only C++ symbols,
and you have `-fprofile-generate` and `-fprofile-force` set,
`-finstrument-functions` instructs the compiler to generate asm code
for C++ symbol functions. It is useful for enabling optimizations in
C++ code. This requires more work to create the asm code but allows
optimalization while creating a profile for C code.

GCC does not currently support `-finstrument-functions` so the C++
compiler is silently ignored for optimization (ie, `-O1` is always
used instead of `-O3`. Also, if `-finstrument-functions` is used, the
C++ compiler is silently ignored for compilation.

`-fverbose-asm`

Turns on verbose, detailed assembly output. This option turns on
verbose code generation for inliners. For many optimizing compilers
inlining is not done when optimization is set to `-O3` or higher. The
detailed assembly code generation can give you good information about
optimizations done during inlining. You can then apply this information to the assembly code to give a better idea of what the
compiler is doing at each location in your program. For details on the
-verbose-asm option, see `gcc -v`.

-fprofile-gnu-unique (GCC)

Produces code to measure unique instructions per function. This
option can be used in addition to any of the other profiling options.

`-fprofile-regmap`

Produces code to map variable addresses to register numbers during
execution and produce more accurate function profiles. This option
requires additional compile time and may produce some code size
increase so only use it if you need to improve profile accuracy. For
more info see `gcc -v`.
\end{blockquote}

See `-fprofile-instr-generate`: https://gcc.gnu.org/onlinedocs/gcc-8.2.0/gcc/Optimize-Options.html#index-fprofile-instr-generate

It is unprecedented that `clang++` is so limited on Linux. It is
extremely useful when working on Linux. However, for an optimized
compilation and when you know what you are doing, you will be able to
set `-fno-profile-arcs` to make the compilation take a tiny bit more
time. You will be able to get rid of a compiler-based profile
instrumentation step by passing `-fprofile-arcs` along with
`-fprofile-instrumented-instr-inlining` and `-fno-profile-arcs`.

In the source code, it is pretty much a black box process. For
example, [the Clang compiler has a profile arcs implementation](https://www.cl.cam.ac.uk/%7Epes20/profiles/Arcs/Clang/), however,
it is a proprietary work, and it is used for the proprietary binary
form, [LLVM](https://clang.llvm.org/docs/LTO.html).

The `-fprofile-arcs` is part of Clang Optimizing Code Generation that
provides the implementation of the following compiler optimizations:

\em{-fprofile-arcs creates an array of counters of the total number of arithmetic instructions performed in
a function. -finstrumented-instr-inlining then counts the number of
function invocations and the number of times function arguments
are passed in registers. This information is used with arcs to
predict the amount of arcs that will be created through inlining}.

When you call the Clang compiler with `-fprofile-arcs`, it creates arcs. If `-fprofile-instr-generate` is
passed, it adds counters. Here are a few snippets of the Linux
Clang profiling implementation:
